  <p>Já passaram <span id="timer"></span>.</p>
  <div id="status">⏳ Ainda aguardamos...</div>

  <footer>© 2025 — OGame Fans Monitor</footer>

  <script>
    const banDate = new Date('2025-10-30T08:11:00');
    function updateTimer() {
      const diff = new Date() - banDate;
      const d = Math.floor(diff / 86400000);
      const h = Math.floor((diff / 3600000) % 24);
      const m = Math.floor((diff / 60000) % 60);
      const s = Math.floor((diff / 1000) % 60);
      document.getElementById('timer').textContent = 
        `${d} dias, ${h} horas, ${m} minutos e ${s} segundos`;
    }
    setInterval(updateTimer, 1000); 
    updateTimer();

    const c = document.getElementById('stars');
    const ctx = c.getContext('2d');
    function resize() { c.width = innerWidth; c.height = innerHeight; }
    window.onresize = resize; 
    resize();

    const stars = Array(150).fill().map(() => ({
      x: Math.random() * c.width,
      y: Math.random() * c.height,
      r: Math.random() * 2
    }));

    function animate() {
      ctx.clearRect(0,0,c.width,c.height);
      ctx.fillStyle = '#fff';
      stars.forEach(s => {
        s.y += 0.2;
        if (s.y > c.height) s.y = 0;
        ctx.beginPath();
        ctx.arc(s.x, s.y, s.r, 0, Math.PI*2);
        ctx.fill();
      });
      requestAnimationFrame(animate);
    }
    animate();
  </script>
